import React, { Component } from "react";
import { css, jsx } from "@emotion/core";

class Form extends Component {
  render() {
    return (
      <form
        css={css`
          height: 200px;
          width: 100px;
          color: white;
        `}
      >
        <label>
          Name:
          <input type="text" name="name" />
        </label>
        <input type="submit" value="Submit" />
      </form>
    );
  }
}

export default Form;
